(164,	'admin-contact-us-request-received',	'Contact request - Jayrn Marques',	'<p>Dear Jayrn&nbsp;Marques,<br />\r\n<br />\r\nSomeone made a contact request from website. User information is as follows.</p>\r\n<p>\r\nFirst Name: Jayrn<br />\r\nLast Name: Marques<br />\r\nEmail: amber.gainey@gmail.com<br />\r\nPhone: 889617862<br />\r\nMessage: Hey Pindersworkwear,\r\n\r\nImagine launching a product and selling out in 48 hourswithout spending a fortune on ads. Sounds like a dream, right?\r\n\r\nThats exactly what happened to EcoStride, a sustainable sneaker brand. Instead of relying only on ads, they used a press release to get featured on Yahoo Finance, Google News, and 150+ media sites.\r\n\r\n 11,400+ visitors in 5 days\r\n 300+ sales before ads even started\r\n 100% free organic traffic from media coverage\r\n\r\nAnd the best part? Writing a press release used to be time-consuming and difficult, but now EIN Presswires AI Press Release Generator makes it fast and effortless.\r\n\r\nJust enter your details, let AI craft a professional press release, and distribute it to top-tier media instantly.\r\n\r\nLaunch your next product the smart way.\r\n\r\nTry It Today: https://marketersmentor.com/sold-out-product-launch.php?refer=pindersworkwear.com&real=yes\r\n\r\nTo your success,\r\nJayrn\r\n\r\n\r\nUnsubscribe: \r\nhttps://marketersmentor.com/unsubscribe.php?d=pindersworkwear.com&real=yes<br />\r\n</p>',	'contact@pindersworkwear.com',	'orders@pindersworkwear.com',	NULL,	NULL,	1,	0,	'2025-03-26 15:30:01',	'2025-03-26 10:00:02'),
